import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { changeOff, changeOn } from "../actions";

function Admin(props) {
  const [typeChange, srtTypeChange] = useState("");

  const change = useSelector((state) => {
    console.log("useSelector", state);
    const { buttonReducer } = state;
    return buttonReducer.change;
  });

  const dispatch = useDispatch();

  const handleOff = (e) => {
    e.target.value = changeOn().text;
    srtTypeChange(!change);
  };
  const handleOn = (e) => {
    e.target.value = changeOff().text;
    srtTypeChange(!change);
  };

  return (
    <div>
      <div>
        <input onClick={change ? handleOn : handleOff} type="submit" />
      </div>
    </div>
  );
}

export default Admin;
